  return (
    <div className="searchbar">
      <SearchBar
        value={searchQuerry}
        placeholder="user name"
        autoFocus
        onChange={(newVal) => props.getSearch(newVal)}
        onRequestSearch={() => setNewVal(searchQuerry)}
      />
    </div>
  );
};

export default Search;
